import React from 'react';

const NextPrevious = ({nexprev, nextButton}) => {
    console.log(nexprev.next);
    console.log(nexprev.previous);

    if (nexprev.next !== null && nexprev.previous !== 0) {
        return(
            <div>
                <button id="previous" onClick={nextButton}>Previous</button>     
                <button id="next" onClick={nextButton}>Next</button>
            </div>
        );
    } else {
        return (<p></p>);
    }
};

export default NextPrevious;
